import re
def create_report(n): return (lambda L: ['Disqualified data'] if 'LABDUC' in L else L)([z for v in sorted(((''.join((w[:6 // len(l) + (len(l) == 4 and i >= 2)] for (i, w) in enumerate(l))), sum((b for (_, b) in g))) for (l, g) in __import__('itertools').groupby(sorted(map(lambda x: (re.split('[\\s-]+', x[0].upper()), int(x[1])), map(lambda s: re.findall('(.+?)\\s+(\\d+)', s)[0], n))), key=lambda t: t[0]))) for z in v])
